<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap" rel="stylesheet">
    <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:ital,wght@0,400..900;1,400..900&family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap" rel="stylesheet">
    <title>404 ERROR!!</title>
    <style>
        * {
            box-sizing: border-box;
        }
        body {
            padding: 0;
            margin: 0;
            overflow: hidden;
        }
        main {
            display: flex;
            align-items: center;
            justify-content: space-around;
            width: 100vw;
            padding-top: 4rem;
            div {
                flex-grow: 1;
                box-sizing: border-box; 
                svg {
                    display: block;
                    margin: auto;
                }
            }
            div:not(.center) svg {
                    width: 70%;
                    height: auto;
                filter: drop-shadow(0 0 10px rgb(138, 138, 138));
            }
        }

        /*Hamberger camponent*/
        @keyframes top-bread {
            from {
                transform:  translateY(calc(-8*1.16vw));
            }
            to {
                transform: translateY(calc(-13*1.16vw));
            }
        }
        @keyframes kiokam {
            from {
                transform: translateX(10%) translateY(calc(-2*1.16vw));
            }
            to {
                transform: translateX(10%) translateY(calc(-4*1.16vw));
            }
        }
        @keyframes tomato {
            from {
                transform: translateX(15%) translateY(0vw);
            }
            to {
                transform: translateX(15%) translateY(calc(-1.5*1.16vw));
            }
        }
        @keyframes bottom-bread {
            from {
                transform: translateY(calc(-0.5*1.16vw)); 
            }
            to {
                transform: translateY(calc(7*1.16vw));
            }
        }
        @keyframes lettuce {
            from {
                transform: translateY(calc(0.5*1.16vw));
            }
            to {
                transform: translateY(calc(5*1.16vw));
            }
        }
        @keyframes chease {
            from {
                transform: translateY(0vw);
            }
            to {
                transform: translateY(calc(3*1.16vw));
            }
        }
        @keyframes four {
            0% {
                transform: rotate(5deg) translate(3% , 3%);
            }
            100% {
                transform: rotate(-5deg) translate(-3% , -3%);
            }
        }
        @keyframes onion{
            form {
                transform:  translateX(15%) translateY(calc(0.5*1.16vw));
            }
            to {
                transform:  translateX(15%) translateY(calc(2.5*1.16vw));
            }
        }
        div.left svg {
            animation: four 8s ease-in-out alternate-reverse infinite;
        }
        div.right svg {
            animation: four 6s ease-in-out alternate-reverse infinite;
        }
        main div.center {
            --hamberger_conteiner_width : 100%;
            justify-items: center;
            position: relative;
            flex-basis: 20%;
            box-sizing: border-box;
            min-width: 20%;
            z-index: 102;
            transform: translateY(-3rem);
            
            svg#top-bread{
                width: var(--hamberger_conteiner_width);
                display: block;
                position: absolute;
                z-index: 50;
                transform: translateX(calc(2.5*1.16vw)) translateY(calc(-10*1.16vw));
                animation: top-bread 2s ease-in-out alternate-reverse infinite;
            }
            div.kiokam {
                width: calc(var(--hamberger_conteiner_width) - 25%);
                padding: 0 10%;
                position: absolute;
                transform: /*translateX(calc(3.5*1.16vw))*/translateX(10%) translateY(calc(-2*1.16vw));
                z-index: 49;
                animation: kiokam 2s ease-in-out alternate-reverse infinite;

                svg {
                    position: absolute;
                    width: 25%;
                }
                svg#kiokam-1 {
                    transform:  translateX(-40%) translateY(-2%);
                }
                svg#kiokam-2 {
                    transform: translateX(-10%) translateY(90%);
                }
                svg#kiokam-3 {
                    transform: translateX(127%) translateY(140%);
                }
                svg#kiokam-4 {
                    transform: translateX(180%) translateY(-40%);
                }
            }
            div.tomato {
                display: flex;
                width: calc(var(--hamberger_conteiner_width) - 35%);
                position: absolute;
                transform: translateY(-0.5rem) translateX(15%);
                z-index: 48;
                animation: tomato 2s ease-in-out alternate-reverse infinite;

                svg {
                    position: absolute;
                    width: 40%;
                }
                svg#tomato-1 {
                    transform: translateX(50%) translateY(-40%);
                }
                svg#tomato-2 {
                    transform: translateX(-20%) translateY(10%);
                }
                svg#tomato-3 {
                    transform: translateX(120%) translateY(30%);
                }
            }
            div.onion {
                display: flex;
                width: calc(var(--hamberger_conteiner_width) - 25%);
                position: absolute;
                transform:  translateX(15%) translateY(0rem);
                z-index: 46;
                animation: onion 2s ease-in-out alternate-reverse infinite;
                svg {
                    position: absolute;
                    width: 30%;
                }
                svg#onion-1 {
                    transform: translateX(72%) translateY(147%);

                }
                svg#onion-2 {
                    transform: translateX(113%) translateY(153%);

                }
                svg#onion-3 {
                    transform: translateX(-11%) translateY(159%);

                }
                svg#onion-4 {
                    transform: translateX(165%) translateY(134%);
                }
                svg#onion-5 {
                    transform: translateX(35%) translateY(139%);
                    width: 18%;
                }
            }
            svg#burger {
                z-index: 47;
                width: var(--hamberger_conteiner_width);
                position: absolute;
                transform: translateY(calc(-1*1.16vw));
            }
            svg#chease {
                z-index: 45;
                width: var(--hamberger_conteiner_width);
                position: absolute;
                transform: translateX(2.5rem) translateY(-1rem);
                animation: chease 2s ease-in-out alternate-reverse infinite;
            }
            svg#lettuce {
                z-index: 44;
                width: var(--hamberger_conteiner_width);
                position: absolute;
                transform: translateX(2.5rem) translateY(-1rem);
                animation: lettuce 2s ease-in-out alternate-reverse infinite;
            }
            svg#bottom-bread {
                z-index: 43;
                width: var(--hamberger_conteiner_width);
                position: absolute;
                transform: translateX(2.5rem) translateY(-0.5rem);
                margin: auto;
                animation: bottom-bread 2s ease-in-out alternate-reverse infinite;
            }
        }

        footer {
            width: 100%;
            justify-items: center;
            z-index: 51;display: flex;
            flex-direction: column;
            align-items: center;
            h1 {
                font-family: Playfair Display;
                display: block;
                font-size: 1.5rem;
                z-index: 100;
            }
            p {
                color: #959895;
                font-family:  Playfair Display;
                max-width: 35rem;
                text-align: center;
            }
            a {
                background-color: #EA6A12;
                color: white;
                text-decoration: none;
                padding: 7px 15px;
                border-radius: 20px;
                font-family: Poppins;
                font-size: 0.8rem;
                transition: 0.4s ease-in-out;
            }
            a:hover {
                padding: 7px 30px;
                box-shadow: 0 0 10px black;
            }
        }
        @media only screen  and  (max-width: 992px) {
            div.center {
                svg#top-bread {
                    top: -1.5rem;
                }
                div.tomato {
                    top: 1rem;
                }
                div.kiokam {
                    top: 1rem;
                }
            }
            
        }
        @media only screen and (max-width: 768px) {
            div.center{ 
                div.kiokam {
                    top: 2rem;
                    width: 27%;
                }
                div.tomato {
                    top: 2rem;
                }
            }
        }
        @media only screen and (max-width: 568px) {
            div.center {
                svg#top-bread {
                    top: -2.5rem;
                }
                svg#bottom-bread {
                    top: -1rem;
                }
            }
            footer {
                margin-top: 3rem;
                h1 {
                    font-size: 1rem;
                }
                p {
                    font-size: 0.8rem;
                }
                a {
                    font-size: 0.8rem;
                }
            }
        }
    </style>
</head>
